import React, { Component } from 'react';
import Axios from 'axios';
import ContentList from '../component/contentList/ContentList';
import 'tachyons';
import setContents from '../lib/youflix';
// 3번째 쓸 경우에는 모듈화시켜라!

export default class Travel extends Component {
  constructor(props) {
    super(props);
    this.state = {
      contents: [],
    };
  }
  // 프리티어

  componentDidMount() {
    this.fetchTravel();
    console.log(2);
  }

  // async await으로 변환 해보기
  fetchTravel = () => {
    const maxResults = 30;
    const token = 'AIzaSyC-v1sIG2Wn3YnoD_7_bBS4zPDceDLKmLY';


    Axios
      .get(`${'https://www.googleapis.com/youtube/v3/search?q=' +
      'travel' +
      '&part=snippet&key='}${
        token
      }&maxResults=${
        maxResults}`)
      .then(({ data }) => {
        const list = setContents(data);

        this.setState({ contents: list });
      });
  }


  render() {
    console.log(1);
    const { contents } = this.state;

    return (
      <div className="mt-3">
        <ContentList contents={contents} />
      </div>
    );
  }
}
